import './App.css';

function App() {
  const [counter, setCounter] = useState(0)

  const handleMinus = () => {
    setCounter(counter - 1)
  }
  const handlePlus = () => {
    setCounter(counter + 1)
  }

  return (
    <div>
      <button onClick={handleMinus}>-</button>
      <span>{counter}</span>
      <button onClick={handlePlus}>+</button>
    </div>
  )
}

export default App
